import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  let [level, setLevel] = useState("");

  return (
    <div className="App">
      <h2>오늘 어떤 운동을 하시겠어요?</h2>

      <div>
        <button
          onClick={() => {
            setLevel("light");
          }}
        >
          가변운 운동
        </button>
        <button
          onClick={() => {
            setLevel("medium");
          }}
        >
          중간 강도 운동
        </button>
        <button
          onClick={() => {
            setLevel("hard");
          }}
        >
          고강도 운동
        </button>
      </div>
    </div>
  );
}

export default App;
